import React from 'react';
import Custom from './Custom';


function App(){
    const data = useCustomCounter()

    return(
        <React.Fragment>
            <h1>Count: {data.count}</h1>
         <button onClick={data.increment}>Click</button>
        </React.Fragment>
        
    )
}
